<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Einstein Teleparallel - Multi-Particle Trajectory Viewer</title>
    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, sans-serif;
            background: #0a0a0a;
            color: #fff;
            overflow: hidden;
        }
        
        canvas {
            display: block;
            width: 100vw;
            height: 100vh;
        }
        
        .controls {
            position: absolute;
            top: 20px;
            left: 20px;
            background: rgba(0, 0, 0, 0.8);
            padding: 15px;
            border-radius: 8px;
            backdrop-filter: blur(10px);
        }
        
        .info {
            position: absolute;
            top: 20px;
            right: 20px;
            background: rgba(0, 0, 0, 0.8);
            padding: 15px;
            border-radius: 8px;
            backdrop-filter: blur(10px);
            max-width: 300px;
        }
        
        h3 {
            margin: 0 0 10px 0;
            font-size: 16px;
        }
        
        .button {
            background: #2980b9;
            color: white;
            border: none;
            padding: 8px 16px;
            margin: 2px;
            border-radius: 4px;
            cursor: pointer;
        }
        
        .button:hover {
            background: #3498db;
        }
        
        .button.active {
            background: #27ae60;
        }
        
        input[type="range"] {
            width: 200px;
        }
        
        #loading {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 24px;
        }
        
        #error {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            color: #e74c3c;
            display: none;
        }
        
        .particle-legend {
            margin-top: 15px;
            padding-top: 15px;
            border-top: 1px solid rgba(255, 255, 255, 0.2);
        }
        
        .particle-item {
            display: flex;
            align-items: center;
            margin: 5px 0;
            cursor: pointer;
        }
        
        .particle-item:hover {
            opacity: 0.8;
        }
        
        .particle-item.disabled {
            opacity: 0.3;
        }
        
        .color-box {
            width: 20px;
            height: 20px;
            margin-right: 10px;
            border-radius: 3px;
        }
        
        .stats {
            font-size: 12px;
            color: #999;
            margin-top: 10px;
        }
    </style>
</head>

        <div style="margin-top: 10px;">
            <label>Speed: <input type="range" id="speed" min="0" max="10" value="3" step="0.1"></label>
        </div>
        <div style="margin-top: 10px;">
            <label>Zoom: <input type="range" id="zoom" min="0.1" max="10" value="1" step="0.1"></label>
        </div>
        <div style="margin-top: 10px;">
            <button class="button" id="toggleTrail">Show Trail</button>
            <button class="button" id="toggleGrid">Show Grid</button>
        </div>
    </div>
    
    <div class="info">

            }
        });
        
        canvas.addEventListener('mouseup', () => {
            isDragging = false;
        });
        
        canvas.addEventListener('wheel', (e) => {
            e.preventDefault();
            const scaleFactor = e.deltaY > 0 ? 0.9 : 1.1;
            cameraZoom *= scaleFactor;
            cameraZoom = Math.max(0.1, Math.min(10, cameraZoom));
            document.getElementById('zoom').value = cameraZoom;
        });
        
        // Initialize
        document.getElementById('loading').style.display = 'none';
        document.getElementById('toggleTrail').classList.add('active');
        document.getElementById('toggleGrid').classList.add('active');
        setupParticleLegend();
        animate();
    </script>
</body>
</html>
